import { Route } from 'react-router-dom';
import Home from './components/Home';

class App extends React.Component {
   renderRoutes = () => {
     <Route path="/" component={ Home } />;
   };

   render() {
     return (
       <div>
         {this.renderRoutes()}
         <p>Opa</p>
       </div>
     );
   }
}

export default App;
